import React from 'react';


//libraries
import styled from 'styled-components';


//images
import logo from './logo.png';

//styles
import './App.css';

const H1 = styled.h1`

`;

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <H1>Dominos Code Ireland</H1>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Latest code is: 
        </p>
        <p>Developed by <a href="https://reactjs.org" target="_blank" rel="noopener noreferrer"> Stephen Byrne </a>
        </p>

      </header>
    </div>
  );
}

export default App;
